import React, { Component } from 'react';
import { BrowserRouter, Route} from 'react-router-dom';

const newRoute = () => {
  return(
      <div>
        <p>new route</p>
      </div>
    )
  }


class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <Route path= '/' component= {newRoute}/>
      </BrowserRouter>
    );
  }
}

export default App;
